const NavContentSetting = () => {
  const dispatch= useDispatch()
  const navSettings=useSelector((state)=>state.navStatus)
  console.log(navSettingsStatus)

  return (
    <div className={classes.navContent_wrapper} onClick={()=>{dispatch(navSettingsStatus(false))}}>
      123123121212
    </div>

  );
};

export default NavContentSetting;
